const time = new Date().toLocaleTimeString();


ReactDOM.render( 
   <> 
   <h1>Hello my name is {name}</h1>
   <p> Today date is: {date} </p>
   <p>Now time is : {time} </p>

   </>

   , document.getElementById("root")  );
